'use strict';
class DXFeedConnectionError {
    errorMessage;
    constructor() {
        this.errorMessage = "";
    }
    getMessage() {
        return this.errorMessage;
    }
    static create(message) {
        let error;
        error = new DXFeedConnectionError();
        error.errorMessage = message;
        return error;
    }
}
module.exports = DXFeedConnectionError
